package de.signWritingEditor.shared.badge.model.material;

import static de.signWritingEditor.shared.i18n.I18NAccess.I18N;

import java.util.Date;

import de.badge.shared.model.domainValue.BadgeLevel;
import de.jsonParser.shared.infrastructure.JsonParser;
import de.signWritingEditor.shared.badge.model.domainValue.DelegsBadgeType;

public class LoginStreakBadge extends DelegsBadge {

	public static final JsonBlankFactory<LoginStreakBadge> JSON_BLANK_FACTORY = new JsonBlankFactory<LoginStreakBadge>() {
		@Override
		public LoginStreakBadge doCreateJsonBlank() {
			return new LoginStreakBadge();
		}
	};

	private static final long serialVersionUID = 3506861635995131897L;
	private static final DelegsBadgeType BADGE_TYPE = DelegsBadgeType.LOGIN_STREAK;

	private static final String BRONZE_BADGE_IMAGE = "data:image/png;base64,";
	private static final String SILVER_BADGE_IMAGE = "data:image/png;base64,";
	private static final String GOLD_BADGE_IMAGE = "data:image/png;base64,";

	private static final int BRONZE_REQUIRED_LOGINS = 3;
	private static final int SILVER_REQUIRED_LOGINS = 7;
	private static final int GOLD_REQUIRED_LOGINS = 21;

	public int currentStreak;
	public int highestStreak;
	private Date lastLogin;

	public LoginStreakBadge(String ownername, Date dateEarned, Date lastLogin, int currentStreak, int highestStreak) {
		super(ownername, BADGE_TYPE, dateEarned);
		this.lastLogin = lastLogin;
		this.currentStreak = currentStreak;
		this.highestStreak = highestStreak;

		doConsistencyCheck();
	}

	public LoginStreakBadge(String ownername) {
		this(ownername, null, null, 0, 0);
	}

	@Deprecated
	private LoginStreakBadge() {
		super();
	}

	@Override
	public String getTitle() {
		return I18N.getLoginStreakBadgeTitle();
	}

	@Override
	public String getDescription() {
		return I18N.getLoginStreakBadgeDescription();
	}

	@Override
	public String getStatus() {
		String result = I18N.getBadgeStatusForHighestRank();

		BadgeLevel level = getCurrentLevel();
		if (level == BadgeLevel.NONE) {
			result = I18N.getLoginStreakBadgeStatusForNone(getMissingLoginsForNextBadge());
		} else if (level == BadgeLevel.BRONZE) {
			result = I18N.getLoginStreakBadgeStatusForBronze(getMissingLoginsForNextBadge());
		} else if (level == BadgeLevel.SILVER) {
			result = I18N.getLoginStreakBadgeStatusForSilver(getMissingLoginsForNextBadge());
		}

		return result;
	}

	public boolean userLoggedIn(Date loginTime) {
		boolean newBadgeReceived = false;

		Date oneDayAfterLastLogin = lastLogin == null ? new Date(0)
				: new Date(lastLogin.getTime() + (1000 * 60 * 60 * 24));
		// same day login
		if (lastLogin != null
				&& yearMonthAndDayFormat.format(loginTime).equals(yearMonthAndDayFormat.format(lastLogin))) {
			// do nothing
		} else if (lastLogin != null
				&& yearMonthAndDayFormat.format(loginTime).equals(yearMonthAndDayFormat.format(oneDayAfterLastLogin))) {
			BadgeLevel oldLevel = getCurrentLevel();
			lastLogin = loginTime;
			currentStreak++;
			if (currentStreak > highestStreak) {
				highestStreak = currentStreak;
			}
			BadgeLevel newLevel = getCurrentLevel();
			if (newLevel != oldLevel) {
				setDateEarned(new Date());
				newBadgeReceived = true;
			}
		} else {
			// more than one day after last login
			BadgeLevel oldLevel = getCurrentLevel();
			currentStreak = 1;
			if (currentStreak > highestStreak) {
				highestStreak = currentStreak;
			}
			lastLogin = loginTime;
			BadgeLevel newLevel = getCurrentLevel();
			if (newLevel != oldLevel) {
				setDateEarned(new Date());
				newBadgeReceived = true;
			}
		}

		return newBadgeReceived;
	}

	@Override
	public BadgeLevel getCurrentLevel() {
		if (highestStreak >= GOLD_REQUIRED_LOGINS) {
			return BadgeLevel.GOLD;
		}
		if (highestStreak >= SILVER_REQUIRED_LOGINS) {
			return BadgeLevel.SILVER;
		}
		if (highestStreak >= BRONZE_REQUIRED_LOGINS) {
			return BadgeLevel.BRONZE;
		}
		return BadgeLevel.NONE;
	}

	@Override
	protected String getBronzeBadgeAsBase64() {
		return BRONZE_BADGE_IMAGE;
	}

	@Override
	protected String getSilverBadgeAsBase64() {
		return SILVER_BADGE_IMAGE;
	}

	@Override
	protected String getGoldBadgeAsBase64() {
		return GOLD_BADGE_IMAGE;
	}

	@Override
	protected void setJson(JsonParser jsonParser) {
		assert jsonParser != null : "Precondition failed: jsonParser != null";

		super.setJson(jsonParser);

		Long longValue = readLongObjectFromJson(jsonParser, "lastLogin");
		lastLogin = longValue == null ? null : new Date(longValue);
		currentStreak = readIntFromJson(jsonParser, "currentStreak");
		highestStreak = readIntFromJson(jsonParser, "highestStreak");
	}

	@Override
	protected String getJson() {
		StringBuilder result = new StringBuilder(super.getJson());

		writeLongObjectToJson(result, "lastLogin", lastLogin != null ? lastLogin.getTime() : null);
		writeIntToJson(result, "currentStreak", currentStreak);
		writeIntToJson(result, "highestStreak", highestStreak);

		assert result != null : "Postcondition failed: result != null";
		return result.toString();
	}

	private long getMissingLoginsForNextBadge() {
		BadgeLevel currentLevel = getCurrentLevel();
		assert currentLevel != BadgeLevel.GOLD : "Precondition failed: assert currentLevel != BadgeLevel.GOLD";

		long result = -1;
		switch (currentLevel) {
		case NONE:
			result = BRONZE_REQUIRED_LOGINS - currentStreak;
			break;
		case BRONZE:
			result = SILVER_REQUIRED_LOGINS - currentStreak;
			break;
		case SILVER:
			result = GOLD_REQUIRED_LOGINS - currentStreak;
			break;
		case GOLD:
		default:
			throw new RuntimeException("you cannot call getMissingLoginsForNextBadge() for level " + currentLevel);
		}

		assert result > 0 : "Postcondition failed: result > 0";
		return result;
	}

}
